import React from 'react';
import { motion } from 'framer-motion';
import { Calendar, MapPin, Building, GraduationCap } from 'lucide-react';
import './Experience.css';

interface ExperienceItem {
  id: number;
  title: string;
  company: string;
  location: string;
  period: string;
  description: string[];
  type: 'work' | 'education';
  icon: React.ReactNode;
}

const Experience: React.FC = () => {
  const experiences: ExperienceItem[] = [
    {
      id: 1,
      title: "Software Engineer",
      company: "NCR Corporation",
      location: "India",
      period: "2021 - 2023",
      description: [
        "Developed and maintained enterprise-level applications using Java and Spring Boot",
        "Collaborated with cross-functional teams to deliver high-quality software solutions",
        "Implemented CI/CD pipelines and automated testing processes",
        "Optimized database queries and improved application performance by 30%"
      ],
      type: 'work',
      icon: <Building size={20} />
    },
    {
      id: 2,
      title: "Masters in Computer Science",
      company: "Indiana University, Bloomington",
      location: "Bloomington, IN",
      period: "2023 - Present",
      description: [
        "Focusing on distributed systems and cloud computing",
        "Researching microservices architecture and containerization",
        "Teaching Assistant for Data Structures and Algorithms course",
        "GPA: 3.8/4.0"
      ],
      type: 'education',
      icon: <GraduationCap size={20} />
    },
    {
      id: 3,
      title: "Software Engineering Intern",
      company: "Tech Startup",
      location: "Remote",
      period: "2023 - 2024",
      description: [
        "Built full-stack web applications using React and Node.js",
        "Implemented user authentication and authorization systems",
        "Worked with cloud services (AWS) for deployment and scaling",
        "Participated in agile development processes and code reviews"
      ],
      type: 'work',
      icon: <Building size={20} />
    },
    {
      id: 4,
      title: "Bachelors in Computer Engineering",
      company: "Osmania University",
      location: "India",
      period: "2017 - 2021",
      description: [
        "Graduated with distinction (First Class)",
        "Specialized in software engineering and web technologies",
        "Completed capstone project on e-commerce platform",
        "Active member of coding clubs and hackathons"
      ],
      type: 'education',
      icon: <GraduationCap size={20} />
    }
  ];

  return (
    <section id="experience" className="experience section">
      <div className="container">
        <motion.div
          className="section-header"
          initial={{ opacity: 0, y: 30 }}
          whileInView={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.6 }}
          viewport={{ once: true }}
        >
          <h2 className="section-title">Experience</h2>
          <p className="section-subtitle">
            My professional journey and educational background that shaped my expertise in software engineering and product management.
          </p>
        </motion.div>

        <div className="experience-timeline">
          {experiences.map((item, index) => (
            <motion.div
              key={item.id}
              className={`timeline-item ${index % 2 === 0 ? 'left' : 'right'}`}
              initial={{ opacity: 0, x: index % 2 === 0 ? -50 : 50 }}
              whileInView={{ opacity: 1, x: 0 }}
              transition={{ duration: 0.6, delay: index * 0.1 }}
              viewport={{ once: true }}
            >
              <div className="timeline-content">
                <div className="timeline-header">
                  <div className="timeline-icon">
                    {item.icon}
                  </div>
                  <div className="timeline-info">
                    <h3 className="timeline-title">{item.title}</h3>
                    <p className="timeline-company">{item.company}</p>
                    <div className="timeline-meta">
                      <span className="timeline-location">
                        <MapPin size={14} />
                        {item.location}
                      </span>
                      <span className="timeline-period">
                        <Calendar size={14} />
                        {item.period}
                      </span>
                    </div>
                  </div>
                </div>

                <div className="timeline-description">
                  <ul>
                    {item.description.map((desc, descIndex) => (
                      <li key={descIndex}>{desc}</li>
                    ))}
                  </ul>
                </div>

                <div className="timeline-type">
                  <span className={`type-badge ${item.type}`}>
                    {item.type === 'work' ? 'Work Experience' : 'Education'}
                  </span>
                </div>
              </div>
            </motion.div>
          ))}
        </div>

        <motion.div
          className="experience-cta"
          initial={{ opacity: 0, y: 20 }}
          whileInView={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.6, delay: 0.4 }}
          viewport={{ once: true }}
        >
          <a href="/resume.pdf" target="_blank" rel="noopener noreferrer" className="btn btn-primary">
            Download Full Resume
          </a>
        </motion.div>
      </div>
    </section>
  );
};

export default Experience;
